import './App.css';
import React from 'react';
import {useState, useEffect} from 'react';
import axios from 'axios';



const App = () => {



const [gigs, setGigs] = useState([]);

useEffect(() => {
    axios
      .get('http://localhost:8080/previousGigs')
      .then((response) => {
        setGigs(response.data)
        })
  }, []);



  return (
    <div className="home">
      <h1>Gig History</h1>
            <div className="gig" >
              <h1>{gigs}</h1>
            </div>
    </div>
  );
}

export default App;
